import Featured from '.../components/Featured';

export default function FeaturedContent(props) {
  return (
    <div className="fc-wrapper">
      <div className="fc">
        <Featured/>
      </div>
    <style jsx>{`
        .fc-wrapper {
          height: 80vh;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .fc {
          width: 70%;
          height: 70%;
          background: black;
        }
      `}</style>
    </div>
  )
}
